  input: '"TEXT","F3XA","C00140590","The committee is aware of the types of activity
    that must be reported on Line 30(b) as FEA.  Please note that none of the activity
    on Line 21(b) or on the H4 schedule is FEA or contains express advocacy.  The
    committee is also aware that certain public communications must be reported if
    a federal candidate is identified.  The committees controller and treasurer review
    all expenditures and their classifications.  Please be advised that if there is
    an expenditure that is identified as FEA, it is paid and reported accordingly
    in the correct manner.      The transfers shown reflect variations due to timing
    of transfers based upon reimbursements from the non-federal and Levin accounts
    the federal account at different points in the 70-day window provided in Reg.
    10-6.7(f)(2).  No transfers were made outside the 70-day window.      The payment
    to BFC Printing on 8/15/05 is an in-kind contribution made on behalf of the committees
    non-federal account.  The expenditure was used to print and purchase door hangers
    for an election matter.  It had no bearing on a Federal candidate or issue.      In
    regard to occupation and employer information requested, a letter is sent to those
    donors whose contribution exceed $200, but did not provide us with their employer
    and occupation on our initial contribution solicitation which sites the FEC regulation
    for the requested information.  The committees policy is to send a follow-up letter
    within thirty days of the original contribution to request this information with
    a pre-addressed envelope enclosed for the return of such information.  All such
    information received is reported accordingly.  If information is received after
    the reporting deadline, the committee will amend the appropriate monthly report.      Sincerely,     Doug
    Boyd  California Republican Party"'
